import React from "react";
import PropTypes from "prop-types";

const ArrowButton = ({ direction, disabled }) => {
  return (
    <button disabled={disabled}>
      {direction === "prev" && "<"}
      {direction === "next" && ">"}
    </button>
  );
};

export default ArrowButton;
